import './index.css'
import { menuData } from './bar'
import { NavLink } from 'react-router-dom'
import React, { Component } from 'react'

export default class index extends Component {
  state = {
    selectedTab: 'home',
    hidden: false
  }
  changeTab = (tab) => {
    this.setState({ selectedTab: tab })
  }
  render() {
    return (
      <div >
        <ul className="container">
          {
            menuData.map(item => (
              <li key={item.key}>
                <NavLink to={item.path} onClick={this.changeTab.bind(this, item.key)}>

                  <div className="link_item">
                    <img src={this.state.selectedTab == item.key ? item.selectedIcon : item.icon} className="link-icon" />
                    {item.name}
                  </div>
                </NavLink>
              </li>
            ))
          }
        </ul>
      </div>
    )
  }
}
